import React from "react";
import "./Quiz.css";
import Navbar from 'react-bootstrap/Navbar';
import CampaignIcon from '@mui/icons-material/Campaign';
import NotificationsNoneIcon from '@mui/icons-material/NotificationsNone';
import PermIdentityIcon from '@mui/icons-material/PermIdentity';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
function Quiz(props){
    var email= props.user.Email;
    var userEmail = email.substring(0, email.lastIndexOf("@"));
    return <>
        <div className="quiz-page">
        <Navbar className="quiz-navbar" expand="lg">
        <div className='quiz-brand'>
        <h1><CampaignIcon className="speaker" fontSize="60" />Quizz</h1>
        </div>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
        <div className="quiz-navs">
        <h4>Practice</h4>
        <h4>Compete</h4>
        <h4>Jobs</h4>
        <h4>Leaderboard</h4>
        <h4>Certification</h4>
        </div>
        <input type="search" name="" id="" placeholder="Search" />
        <NotificationsNoneIcon sx={{ fontSize: 30 }} className="bell" />
        <div className="logined-user">
            <PermIdentityIcon  className="account-human" />
            <h4 className="account-email">{userEmail}</h4>
            <KeyboardArrowDownIcon />
        </div>
        </Navbar.Collapse>
        </Navbar>
        </div>
    </>
}

export default Quiz;
